import React from 'react';
import './car.css'
import {BrowserRouter as Router, Route, Link} from 'react-router-dom'



import MainAnimation from './mainAnimation';
import BottomAnimation from './bottomAnimation'


class App extends React.Component{
    render(){
        let redCar = <img src={require("./imagies/auto.png")} style={{
            width:"20%",
            height:"10%"
        }}alt="car" className ="fastCar"/>
        return(

            //   <div>
            //     <MainAnimation/>
            //     <BottomAnimation car ={redCar}/>
            // </div>  


            <Router>
                <Route exact path = "/" component={MainAnimation}/>
                <Route  exact path='/'render={(car) => <BottomAnimation  car ={redCar} />}
/>

            </Router>


        )
    }
}

export default App;
